import React,{Component} from'react'


class Services extends Component {
constructor(props) {
    super();

    this.state={
        count:'0',
        email:'sivaawesome234@gmail.com'
        
    }
}
render() {
    return(<><div className='p-5'>
        {this.state.email}<br/><br/>
        Cart:{this.state.count}<br/>
        <button>Hitme</button>
        </div> </>)
        }


}

export default Services
